import React from 'react';
import { useNavigate } from 'react-router-dom';

interface props {
    content: string;
    //goBack: (state: number) => void
}

const navigate = useNavigate();
const handleClick = () => navigate(-1);

export const Navbar = ({ content }: props) => {
    return (
        <div className="flex justify-center items-center static bg-orange-400 py-6 text-2xl">
            <div className="absolute  left-20 " onClick={handleClick}>
                <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="26"
                    height="26"
                    fill="currentColor"
                    className="bi bi-chevron-left bg-green-500"
                    viewBox="0 0 16 16"
                >
                    <path
                        fill-rule="evenodd"
                        d="M11.354 1.646a.5.5 0 0 1 0 .708L5.707 8l5.647 5.646a.5.5 0 0 1-.708.708l-6-6a.5.5 0 0 1 0-.708l6-6a.5.5 0 0 1 .708 0z"
                    />
                </svg>
            </div>

            <p>{content}</p>
        </div>
    );
};
